import React,{Component} from "react";
import { Line } from 'react-chartjs-2';

class Chart extends Component{    
    render({data,options}){
        return (
            <>
                <div className='header'>
                <h1 className='title'>Price</h1>
                </div>
                <Line data={data} options={options} />
            </>
        );
    }
}

export default Chart;
